BEGIN;
INSERT INTO `comments` VALUES ('7', '保险行业（天安财险），股东无基金,多为产业资本和个人。收入处于改善中', 'sh600291', '2016-05-04 23:41:51', '2016-05-04 23:41:51'), ('8', '美的等产业资本控股，利润走上坡路。主要是小天鹅洗衣机。', 'sz000418', '2016-05-04 23:42:15', '2016-05-04 23:42:15'), ('9', '木业家具，聚焦木业。社保基金入住。', 'sz000910', '2016-05-04 23:42:43', '2016-05-04 23:42:43'), ('10', '出现产业资本增持(香港中央结算有限公司在不断增持)，个人人员进入的情况。\n总持股人数在持续减少。流通市值283亿。', 'sh600660', '2016-05-04 23:43:13', '2016-05-04 23:43:13'), ('11', '周期股，业绩不好。大批个人新进。', 'sz000789', '2016-05-04 23:43:46', '2016-05-04 23:43:46'), ('12', '收入和利润每年在减少。 私募重仓。 公司在投资并拓宽业务渠道。\n挪威中央银行从15年底进入并买进。是什么让他在买入？', 'sh600309', '2016-05-04 23:44:13', '2016-05-04 23:44:13'), ('13', '现金比率 = 现金及现金等价物／流动负债\n利息支付倍数 ＝ 税息前利润/利息费用，通常指少为1.5倍。如果为负数，说明净利息为正（投资产生利息高于借款产生利息），财务状况非常健康的表现。\n经营活动产生的现金流量净额 = 现金及现金等价物的净增加额－筹资活动产生的现金流量净额－投资活动产生的现金流量净额\n现金及现金等价物净增加额 ＝ 现金的期末余额—现金的期初余额', 'sh000001', '2016-05-07 22:46:29', '2016-05-07 22:46:29'), ('14', '年度营收，利润持续增长。利润率及净资产收益率在走高。\n轻债务。\n现金流不错，经营性现金流增加，但银行理财产品投资规模增大（公司将投资理财纳入经营范围作为常规性收入）。并在还清贷款。\n股东人数在减少，人均持股增多\n主要流通股东为产业资本和社保基金（新增境外法人？）', 'sz000418', '2016-05-08 00:19:03', '2016-05-08 00:19:03'), ('15', '第二层思维，别人都看好，抢着买的时候（股价处于上升并创出新高，基本面一片大好），恰是你谨慎的时候。\n买的理由很多，不买的理由，还是嫌贵。\n当时选的理由是，市现率比较低在5.4左右。同时，受趋势投资理念影响，股票升值时应买入。', 'sz000418', '2016-05-08 10:09:48', '2016-05-08 10:09:48'), ('16', '第一季度每股经营现金流（TTM），2.79元，市现率4.81', 'sz000910', '2016-05-08 11:14:46', '2016-05-08 11:14:46'), ('17', '截断亏损，让利润奔跑。\n触发10%绝对止损线，直接清仓。 这个股票仓位较重，是不应该的。预计损失6700。\n另外，是一支白马股。当时买的理由主要是低市盈率，目前依然是。但依然是在市场高位买入的。\n卖的理由是，人人都看好的股票，同时市值很大（3,573亿）。卖出后给新的股票留出投资空间来。', 'sh600036', '2016-05-08 11:21:36', '2016-05-08 11:21:36'), ('18', '30.88买入，当前价格28.89，亏损幅度6.45%。 如果触发10%的止损线，坚决清空。\n.... 不要等市场证明你是错的时再止损。立刻卖掉吧。', 'sz000418', '2016-05-08 11:23:35', '2016-05-08 11:23:35'), ('19', '《华尔街幽灵》规则一，只持有正确的仓位。 永远不要等着市场提醒你已经出错。\n                         规则二，毫无例外并且正确地对你的盈利仓位加码。 加码时，要遵守规则一，确保正确的加码。\n\n保持利润的方式，一个是持有，另外一个就是加大仓位（个人思考）', 'sh000001', '2016-05-08 11:53:15', '2016-05-08 11:53:15'), ('20', '12月25日讯 大亚科技（000910）12月25日晚间公告，公司控股股东大亚集团12月25日通过深圳证券交易所交易系统以竞价交易的方式增持公司股份332，800股，占公司总股本的0.06%，增持均价为16.61元/股\n\n作者：大亚科技(SZ000910)\n链接：https://xueqiu.com/S/SZ000910/62483915', 'sz000910', '2016-05-08 18:04:36', '2016-05-08 18:04:36'), ('21', '公司规模显著超过德尔家居，去年总收入、地板业务收入、地板销量等指标分别是德尔家居的12.4倍、5.9倍、4.8倍，但市值仅是德尔家居的0.7倍。当前公司PS不到2倍，远低于A股家具上市公司平均PS水平，公司价值严重低估。目前公司营业收入65亿元（资产剥离后），净利率约3%，其中地板收入约40亿元，净利率仅2.3%，远低于同业竞争对手（大自然约10%、德尔家居近20%），预计公司净利率有望逐步恢复至10%左右，合理净利润6亿元左右，是当前净利润近3倍。\n链接：http://money.163.com/15/0610/13/AROKEKIN00253B0H.html', 'sz000910', '2016-05-08 18:10:09', '2016-05-08 18:10:09'), ('22', '业务处于聚焦中，新上管理层营运水平在观察中，股价向下走，市场新闻很久不更新，\n社保在买进，基金在减持，好事。 \n每股收益0.6，市净率2.95，市盈率21.2, 市现率4.81\n这些信号作为买入的理由足够了？', 'sz000910', '2016-05-08 18:22:55', '2016-05-08 18:22:55'), ('23', '看了上证指数和深成指数，发现成交量就很能说明人气。 \n市场清淡，门可罗雀时周成交量都在500亿以下，目前的成交量都在500亿以下，也就是说市场还没有到可以大量买入的时候，\n卖出后轻仓观望。在更多人恐惧时买入吧。现在需要的是沉住气，耐心，耐心～～～～', 'sh000001', '2016-05-08 19:25:04', '2016-05-08 19:25:04'), ('24', '考虑适度买入，但一定是压价买入。 因为市场还没有到让人恐惧的时候。买高会带来风险。\n---------------------------------------\n试图低价买入或者高价卖出，都是猜测时机和赚尽股市的每一分钱在作祟，不好的思想，应买入。', 'sh600660', '2016-05-08 19:26:09', '2016-05-08 19:26:09'), ('25', '资本重组的玩法，和做实业关系不大，谨慎看待。 股价便宜，深跌可考虑。', 'sh600291', '2016-05-08 19:41:36', '2016-05-08 19:41:36'), ('26', '每个股票的上限是，买入资金的20%。\n保持现金的底线是总市值的10%，也就是说，买入时不能导致现金低于这个线。 如果总市值增长导致低于这个数值时，应考虑卖出部分股票。\n保留现金让你能应付显示中一些突发事件，达到长期持有的目的。\n另外，作为纪律，可以保持轻仓心态，永远不会孤注一掷。在人气鼎沸时，强制卖出；试图超低时，也不至于抄到山腰。\n始终保持现金是一种境界～～～', 'sh000001', '2016-05-08 21:39:18', '2016-05-08 21:39:18'), ('27', '挪威中央银行持有，饲料行业。', 'sz002311', '2016-05-08 21:53:51', '2016-05-08 21:53:51'), ('28', '挪威中央银行持有，国内机构有减持。化肥行业，业绩指标处于上行，但股价是否偏高？', 'sz002470', '2016-05-08 22:11:09', '2016-05-08 22:11:09'), ('29', '从买入损失已达到10%。大盘处于低点，在别人恐惧犹豫中积极进取，买入。 仓位达到50%，下跌的话再买入。', 'sh600291', '2016-05-10 13:21:36', '2016-05-10 13:21:36'), ('30', '大盘处于低点，在别人恐惧犹豫中积极进取，买入。 仓位达到50%。', 'sh600309', '2016-05-10 13:22:11', '2016-05-10 13:22:11'), ('31', '大盘2800点处于低点，在别人恐惧犹豫中积极进取。等待更低点买入，是犹豫懦弱的同义词。 另外，目前仓位1/4，需要加大仓位。', 'sh600660', '2016-05-10 13:23:36', '2016-05-10 13:23:36'), ('32', '根据历史规律，深证A股市盈率25倍以下，大盘才处于低位，应满仓操作。在这之前，应轻仓参与，保持耐心。', 'sh000001', '2016-05-11 22:53:20', '2016-05-11 22:53:20'), ('33', '既然大盘没有跌到位，为什么要继续买入？\n当前每股盈余0.32，市现率(141.92+82.99-102.71)/21.79＝5.6，也偏高，应继续等待。', 'sh600291', '2016-05-11 23:06:14', '2016-05-11 23:06:14'), ('34', '下跌超过10%，达到止损线，清盘卖出。', 'sh600291', '2016-05-18 21:48:38', '2016-05-18 21:48:38'), ('35', '截止目前，每股净资产4.4  每股经营现金流2.79', 'sz000910', '2016-05-18 23:38:16', '2016-05-18 23:38:16'), ('36', '截止目前，每股净现金流2.62，每股净资产5.36。\n股价15.34，市现率5.85，市净率2.86', 'sh600309', '2016-05-18 23:44:03', '2016-05-18 23:44:03'), ('37', '截止目前，每股净现金流1.32，每股净资产6.78。\n当前价格 13.8, 市现率10.45，市净率2.04\n', 'sh600660', '2016-05-18 23:49:09', '2016-05-18 23:49:09'), ('38', '年度收入、利润下降严重，负债率在增长，年度流动速比在下降，现金比率21.90。 股东以基金居多。不建议关注。', 'sz000422', '2016-05-23 22:18:17', '2016-05-23 22:18:17'), ('39', '营收，利润在回升。\n北京地铁周边房地产开发\n北京市基础设施投资有限公司增持，大成价值增长证券投资基金进入\n程少良是何许人？作为两次股权的受让方，其身份引人关注。据银泰资源披露，中国银泰的最终股东为两位自然人，一位是沈国军，持有中国银泰75%的股份；另一位则是程少良，持有中国银泰25%的股份。\n关于股权腾挪的原因，当时银泰资源公告称，中国银泰与程少良构成一致行动人。中国银泰的两位最终自然人股东沈国军和程少良将逐步理清关系，最终程少良将退出中国银泰', 'sh600683', '2016-05-23 22:36:56', '2016-05-23 22:36:56'), ('40', '房地产开发和经营.基金持有比较多', 'sz002133', '2016-05-23 22:51:58', '2016-05-23 22:51:58'), ('41', '收入 房地产为多\n经营的业务变更为化纤业务和房地产业务共同发展的多元化格局', 'sz000615', '2016-05-23 22:54:59', '2016-05-23 22:54:59'), ('42', '大宗商品采购供应及综合物流\n产业资本绝对控股，社保基金持股\n13年开始转型到粮食生产供应商', 'sh600057', '2016-05-23 23:07:14', '2016-05-23 23:07:14'), ('43', '污水处理\n个人、中央汇金持股', 'sh600874', '2016-05-23 23:28:45', '2016-05-23 23:28:45'), ('44', '去年12月29日，国投电力公告，将定增发行价格下调至不低于7.95元/股，发行数量上调为不超过11.32亿股。事隔一月后，昨日国投电力股价报收6.37元/股，下跌8.08%，相比7.95元/股的定增发行底价，已经下跌24.8%。\n\n面对股价跌破增发底价，国投电力只能终止90亿元定增计划。公司表示，此次非公开发行事项终止不会对公司正常生产经营与持续稳定发展造成不利影响，不会损害公司及股东的利益。', 'sh600886', '2016-05-26 10:29:07', '2016-05-26 10:29:07'), ('45', '市盈率8，市现率1.9，总市值437亿\n社保，香港中央结算，个人进入', 'sh600886', '2016-05-26 10:41:54', '2016-05-26 10:41:54'), ('46', '小市值电力股票\n长源电力可控总装机容量为360.08万千瓦，全部为火电装机，占湖北全省火电装机容量2500.84万千瓦的比重为14.4%\n个人投资者居多，估计波动会比较大', 'sz000966', '2016-05-26 10:51:31', '2016-05-26 10:51:31'), ('47', '股东中一大堆中证金融资产管理计划', 'sh600426', '2016-05-26 11:15:56', '2016-05-26 11:15:56'), ('48', '房地产股', 'sh600240', '2016-05-26 11:27:47', '2016-05-26 11:27:47'), ('49', '选股策略，市盈率20倍以下，市现率小于6倍，流通市值小于500亿。\n发现 前面都是电力股', 'sh000001', '2016-05-26 11:53:20', '2016-05-26 11:53:20'), ('50', '副总经理增持0.19万股（1900股，合计不到2万元），用7.79元，在2016-05-12日', 'sz002470', '2016-05-31 11:35:20', '2016-05-31 11:35:20'), ('51', '据不完全统计，全球园艺类肥料、植保产品花土、化肥、种子等容量超过110亿美元，且随着发展中国家经济的快速发展，人们不再满足\"居而有其所\"的简单生活，开始追求居住环境绿化的更高需求。特别是在中国，随着城市化步伐加快，未来五年中国园艺类肥料、植保产品需求将呈现快速增长的态势。目前，中国园艺作物种植面积约6000万亩，仅肥料年需求量超过300万吨。初步测算中国园艺类肥料、植保产品市场超过100亿元。而当前中国园艺用品企业数量众多，但以中小型企业为主，专业化、规模化程度不高。金正大通过收购康朴公司，可以将其积累的家庭园艺和植保产品的技术、产品、服务、营销经验引进中国，并利用其品牌影响力，服务于中国巨大的园艺市场，促进公司在中国园艺市场的开发。', 'sz002470', '2016-05-31 11:43:17', '2016-05-31 11:43:17'), ('52', '拟7.5元买入1300股。理由是，整个财务状况向好。市现率偏高，9。 公司专注农业肥料，和国外农业企业合作，负责人（1965年7月出生）是一个踏实且有抱负的人。', 'sz002470', '2016-05-31 12:07:54', '2016-05-31 12:07:54'), ('53', '国有企业。 财务指标不好。主营汽车服务／汽车贸易，利润率低于5%', 'sh600335', '2016-05-31 12:13:03', '2016-05-31 12:13:03'), ('54', '羊绒和矿业为主业。收益下滑，财务指标不好。', 'sh600295', '2016-05-31 12:21:38', '2016-05-31 12:21:38'), ('55', '股价最低跌到7.52，然后就上涨6%以上，今天再次上涨2%。 这是没有买到的风险。\n整个行业集中度不高。同行（史丹利）正在试图转型，金正大也在搞国际化，试图转型？', 'sz002470', '2016-06-07 00:03:10', '2016-06-07 00:03:10'), ('56', '大堆基金股东，放弃', 'sh600048', '2016-06-08 15:33:45', '2016-06-08 15:33:45'), ('57', '大堆基金股东，放弃', 'sz000786', '2016-06-08 15:34:04', '2016-06-08 15:34:04'), ('58', '3月后，大批基金进入。', 'sz000789', '2016-06-08 15:35:22', '2016-06-08 15:35:22'), ('59', '长源电力股东能源集团减持会打压股价，观望等待', 'sz000966', '2016-06-08 15:43:17', '2016-06-08 15:43:17'), ('60', '化工产品及部分商品房销售', 'sz000707', '2016-06-09 21:41:50', '2016-06-09 21:41:50'), ('61', '再次计划7.5买入1500股。 这个价位处于历史股价的地位。\n就像潘峰说的，如果你的持股处于历史地位，那么，你的心态要远远好于价位在你之上的人。你可以持股并成熟损失。\n如果长期不涨，也应该考虑下股息率。。。。。。。', 'sz002470', '2016-06-13 23:52:42', '2016-06-13 23:52:42'), ('62', '如果你是长期投资，那么股息在股票不涨的时候就很重要。 考虑下按照股息率选股。', 'sh000001', '2016-06-14 00:03:18', '2016-06-14 00:03:18'), ('63', '搞了一个股权激励，340万股，7.04买的，锁定期3年，年均增长要求15%以上', 'sz000910', '2016-06-30 23:06:13', '2016-06-30 23:06:13'), ('66', '通过临沂新天投资公司增资8亿收购欧洲园艺公司。控股股东，大股东质押股权融资，大投入要做什么？', 'sz002470', '2016-06-30 23:25:42', '2016-06-30 23:25:42'), ('67', '8亿增资理应是利好，但金正大利好不涨很反常，也对金正大这种不差钱公司让出绝对控股地位很困惑，所以做了一下功课。\n\n网上有声音说这次收购和担保导致上市公司利益减少，其中隐含农商一号套路，也就是收购优质资产，优质资产再由金正大上市团队管理，利用上市公司各种优势打造一个优质平台，之后成熟了再以更高的溢价天价把原本就是金正大下属的子公司卖给上市公司，进行利益转移，公司现金流挖空。\n\n鉴于这种假设，和收购标的无法合并报表影响，下调金正大业绩预期，暂时将金正大列入负面观察名单，待半年报明朗再考虑是否重新纳入价值投资选股组合。\n中国股市，好股多，垃圾股更多，坑害散户利益的好股比垃圾股还多，稍有不慎就会被坑，谨慎使得万年船，谨慎方可不断的资产新高～', 'sz002470', '2016-06-30 23:48:56', '2016-06-30 23:48:56'), ('68', '从2011年以来淡水泉的选股以及操作来看，还是有些明显的偏好。\n\n　　1.虽然淡水泉团队的主要成员均出自公募，但在转行私募后，还是有明显的变化，至少没有出现公募操作中常见的同门一个产品加仓、一个产品减仓的矛盾行为，基本呈同进同出，投资也显得相对比较集中。\n\n　　2.持股周期相对较长。众所周知，在持股长周期中不仅要能够抵挡上涨获利后的兑现诱惑，如遇到持续的下跌，更是考验操盘者的心理承受能力。我们能看到的是，淡水泉在海大集团上，经历了两次股本扩张周期中的上涨，在豪迈科技也是如此。而在合兴包装、大亚科技的下跌甚至是长期下跌中，也能敢于守仓或是持续加仓，说明淡水泉对自身选择的标的还是有信心的。\n\n　　3.选择标的仍以小市值为主。海大集团、海陆重工、豪迈科技在初次建仓时的流通盘均在1亿股以下。而其他标的，在除去大股东之外的实际流通市值大多在10多亿元，绝对股价也都比较低。\n\n　　4.在建仓时点上也确实有左侧交易的特点。如豪迈科技是在经历了股价自32元到16元的腰斩之后进场，通富微电是在其从20多元跌至5元多后进场，大亚科技是从13元多跌至4元多开始进场。', 'sh000001', '2016-07-04 23:51:29', '2016-07-04 23:51:29'), ('69', '股票在上涨，私募重仓。\n近年财务指标再走下坡路..... 机会还是陷阱？', 'sh600309', '2016-07-07 22:26:47', '2016-07-07 22:26:47'), ('70', '受原油价格暴跌影响PDH产业链盈利下滑厉害。8月底公司环氧丙烷及丙烯酸一体化项目试车成功，公司八角工业园 2015年正式投产，但由于原油价格暴跌，丙烯价格失去成本支撑，煤制烯烃和PDH盈利大幅下滑，公司八角项目的盈利受到考验，目前随着原油价格的回升，PDH产业链盈利有所改善。考虑到目前MDI处于价格低点，未来向上概率大，同时原油价格上涨将带动PDH盈利回升。（等待油价上升？ 如果油价上升，则盈利会立刻改善）', 'sh600309', '2016-07-07 22:37:47', '2016-07-07 22:37:47'), ('71', '中国大宗商品发展研究中心秘书长、生意社总编刘心田的赞同，他告诉本报记者，万华化学的优劣势都较为明显。优势是行业垄断优势及人员管理素质较高；劣势是产业链条、技术积累等相较巴斯夫等国际同行依然有差距，同时经济和油价低迷对公司业绩形成打压。', 'sh600309', '2016-07-07 22:40:07', '2016-07-07 22:40:07'), ('72', '私募和产业资本重仓。 电子消费产业，包括VR，比较火热和时尚。', 'sz002241', '2016-07-07 22:53:07', '2016-07-07 22:53:07'), ('73', '淡水泉在2015年前三季度一直只有单只产品持有天士力，且四季度以前（不含四季度）的主要仓位在一季度已经基本建立，二季度和三季度增持幅度并不大。如果淡水泉另外两只产品也是在一季度就布局天士力，直到四季度才出现在其流通股东名单中，', 'sh600535', '2016-07-07 22:56:26', '2016-07-07 22:56:26'), ('74', '市现率接近市场高点，但市净率在历史低点\n--------------------------------------------------\n忽略市净率，市盈率，市销率，市现率都处于历史较高点', 'sh600660', '2016-07-14 23:10:37', '2016-07-14 23:10:37'), ('75', '市现率，市净率处于历史低点。 市盈率处于高点，以哪个为准？\n明天加仓1万。目前已盈利接近20%以上。', 'sh600309', '2016-07-14 23:16:07', '2016-07-14 23:16:07'), ('76', '看多是仓位逐步增至50%以上，最高只能到75%－80%。一旦有回调，应减仓到50%以下，直到清仓。\n如果价格偏离价值太多，同时股票盈利也很高时，应考虑落袋并逐步建仓。 控制风险第一。\n今天潘峰说的，因为要长期待在市场，利润是不断累积出来的。 而不可能指望满仓，一两次操作翻身。 \n一旦养成满仓操作的习惯，及时偶尔有几次幸运，但最终会死的很惨。\n老兵不死，来自经验和谨慎～～', 'sh000001', '2016-07-14 23:23:50', '2016-07-14 23:23:50'), ('77', '已盈利，市值80亿较低，加仓买入跟进。 趋势投资理念的影响。 试一试看。 \n今日加仓的主要是市现率较低大亚科技和万华化学，主要考虑是估值更低。大亚科技市值更小。\n未来如果出现回调，考虑减仓首先卖出 市值较大，市现率较高的股票。 \n市场上如发现市现率更低的股票，可考虑换仓。', 'sz000910', '2016-07-15 10:19:00', '2016-07-15 10:19:00'), ('78', '倾向流通市值小于20亿以下的股票', 'sh000001', '2016-07-16 21:31:14', '2016-07-16 21:31:14'), ('79', '流动比率 低于0.5', 'sz000966', '2016-07-18 09:42:06', '2016-07-18 09:42:06'), ('80', '市盈率绝对值偏高，但属于历史低值。 销售情况连续三年没有扩大。', 'sh600664', '2016-07-18 09:45:24', '2016-07-18 09:45:24'), ('81', '市净率，市盈率，市现率均在市场低位。流通市值122亿。', 'sh600426', '2016-07-19 17:23:02', '2016-07-19 17:23:02'), ('82', '淡水泉信奉“逆向投资”，认为股票市场中情绪聚集的地方不容易找到好的投资标的，公司团队更喜欢在被市场“忽略”和“冷落”的地方去“淘金”，越是不被看好的投资，公司越是加强对其基本面的研究，以期先于市场发现投资机会。 同样是分享企业未来的成长，淡水泉始终恪守两个准则： 1、可被证明的过往经营能力； 2、合理的估值水平。\n \n重阳投资秉承价值投资理念，将“发现并投资确定的低估成长公司”作为投资研究的第一目标，通过前瞻性地分析宏观、行业和公司基本面并运用严谨的多元化估值方法来发现低估的投资标的，实现管理资产的持续高复合成长。', 'sh000001', '2016-07-30 23:31:15', '2016-07-30 23:31:15'), ('83', '新型环保农药的研发和生产', 'sz000525', '2016-07-30 23:56:12', '2016-07-30 23:56:12'), ('84', '大股东2016-02-02以14.12价格定向增发10亿元', 'sz000525', '2016-07-31 09:59:20', '2016-07-31 09:59:20'), ('85', '6月份派息每股5元，大大高于往年，何故？', 'sz000525', '2016-07-31 10:07:07', '2016-07-31 10:07:07'), ('86', '目前，两市涉及百草枯概念的上市公司有：沙隆达A（000553.SZ）和红太阳（000525.SZ）。\n\n**百草枯禁令公告内容**\n\n根据农业部、工业和信息化部、国家质量监督检验检疫总局1745号公告，自2014年7月1日起,撤销百草枯水剂登记和生产许可，停止生产，仅保留母药生产企业水剂出口境外使用登记，允许专供出口生产。2016年7月1日起停止百草枯水剂在国内销售和使用。\n\n根据公告的时间，目前留给国内百草枯水剂生产的时间仅剩下不足2个月，而百草枯水剂在市场上的流通时间也仅余2年零2个月。\n', 'sz000525', '2016-07-31 10:14:49', '2016-07-31 10:14:49'), ('87', '选股重于选时。 所谓 选时，不免就有预测股市涨跌，大涨大跌的含义在里面。而事实证明，股市被准确预测是极难的。所以不要把精力消耗在猜股票未来的涨跌。\n应集中精力挑选股票（快速成长/价格合理）。如果你实在挑不大，那其实也暗含整个股市已经很高了。\n而在熊市，你会发现到处都是被低估的股票。 也就是做到了，别人在担心下来股票涨跌的时候，你已经在买进了。\n这样，无论股市涨跌，你对股票的选择标准没有变，工作焦点没有变。\n但在客观上却造成了，逆市操作的风格。\n股票合适卖，应按照你对具体股票的风格定义。\n如果不是快速增长型的股票，那么就在价值回归时卖掉他即可。还是不要把宝贵的精力放到预测股票涨跌上去。\n就好比是商人，你关心的是好交易。 而不是像大学教授一样，预测整个市场走势（或某个股票）的未来涨跌。', 'sh000001', '2016-07-31 21:47:09', '2016-07-31 21:47:09'), ('88', '彼得公司类型划分：\n   缓慢增长型（2%-4%）\n   稳定增长型（10%-12%）-合理的价格买入\n   快速增长型（20%-25%）-注意负债，不要让一个意外\n   周期型-多是著名公司，容易和稳定增长型公司混淆。时机选择是关键。行业内部人能提早发现复苏的苗头，提早布局买入。\n   困境反转型\n     1-大而不能倒\n      2-谁会想到。机遇型。\n      3-问题没有想象的那么严重\n      4-破产母公司中经营良好的子公司\n      5-重组。多元恶化\n\n   隐蔽资产型\n       从身边常识出发。发掘有长期价值的资产，持有并买入。\n', 'sh000001', '2016-07-31 22:06:42', '2016-07-31 22:06:42'), ('89', '重阳自9月30号开始进入前十大流通股东名单（相关股票合计达到5%），到目前为止股份没有丝毫减持。 已被套在该股票中。\n上海太富祥尔股权投资基金2015年12月31号进入十大流通股东名单。要约收购40元。\n9月23号开始停牌，控股股东拟增持，最终未增持。疑似保护股价的措施而已。', 'sh600315', '2016-07-31 22:08:05', '2016-07-31 22:08:05'), ('90', '拟以29元先买1万元。', 'sh600315', '2016-08-01 00:01:31', '2016-08-01 00:01:31'), ('91', '上海太富祥尔股权要约收购后，是的平安集团控股达到58.87.  平安看好日化的发展，在本土成两位数增长', 'sh600315', '2016-08-01 10:14:26', '2016-08-01 10:14:26'), ('92', '上海家化公布的2015年第一季度报告显示，该季度公司营业收入为15.95亿元，同比增长18.52%；归属母公司所有者的净利润为1.90亿元，同比增长16.01%，折合每股收益为0.28元。不过，其经营活动产生的现金流量净额比上年同期减少了71%。\n\n　　“经营性现金流下降说明销售周转率下降，货品周转慢、库存加大，目前来看对业绩短期影响不大，但这样的趋势若持续，未来会对业绩产生一定影响。”上述日化业内人士对本报记者表示。', 'sh600315', '2016-08-02 20:31:40', '2016-08-02 20:31:40'), ('93', '谢文坚空降上海家化，平安入主，葛文耀隐退，存在文化融合的风险。', 'sh600315', '2016-08-02 20:49:11', '2016-08-02 20:49:11'), ('94', '现金流不好，等待中报业绩。 如无改善，尽快则时退出。', 'sh600315', '2016-08-02 22:23:56', '2016-08-02 22:23:56'), ('95', '业务量在恢复和改善中，发生了什么？\n主要因本期公司油轮及\n散货船队有效运力增加，油轮市场持续景气，船队经营抓住了市场机会，同时燃油价格较低。', 'sh601872', '2016-08-02 23:03:58', '2016-08-02 23:03:58'), ('96', '市现率和市盈率处于低位，有低估价值。', 'sh601872', '2016-08-02 23:04:34', '2016-08-02 23:04:34'), ('97', '投资者中机构投资者产业资本有一些', 'sh601872', '2016-08-02 23:50:32', '2016-08-02 23:50:32'), ('98', '拟计划5元先买入2500股', 'sh601872', '2016-08-03 00:00:19', '2016-08-03 00:00:19'), ('99', '恒大保险入住，收购体系。主题概念。', 'sh600512', '2016-08-06 21:56:56', '2016-08-06 21:56:56'), ('100', '财务状况良好，市盈率低于万华。（计算不对，因为转增，股本增加，市盈率和市现率都要乘以2）\n股东以个人为多。拟以6.5元，先买入1万元股份。\n上述决定取消。估值过高。', 'sz002361', '2016-08-06 23:42:41', '2016-08-06 23:42:41'), ('101', '年度现金流下降比较严重（年报查询后发现系记账方式调整所致。财务报表中存货不多，可理解），2016年第一季度现金流已较同期增加很多。\n 市现率较高，行业押款比较严重？\n控股股东近期增持。\n（缺点）机构持股比例不小\n-----------------------------------\n人寿保险公司于9月进驻，获得了更加长期的资本。应加仓持有。', 'sz002367', '2016-08-09 23:22:33', '2016-08-09 23:22:33'), ('102', '主营收入连续三年下降。利润和现金流维持增高。 不是快速成长股，只能在低估时买入在高估时卖出（透支未来收益）。', 'sz000966', '2016-08-13 23:45:52', '2016-08-13 23:45:52'), ('103', '中报显示，营收/利润/现金流都出现负增长，因此选择售出股票。', 'sh600315', '2016-08-18 22:49:48', '2016-08-18 22:49:48'), ('104', '中报显示，现金流也显示连续下降。但贵在历史较低的市盈率，因此持有\n--------------------------\n营收连续三年下降，现金流连续下降，中报显示利润也低于去年同期.........', 'sz000966', '2016-08-18 22:55:31', '2016-08-18 22:55:31'), ('105', '周期性股票，择高卖出。', 'sh600660', '2016-08-18 23:33:37', '2016-08-18 23:33:37'), ('106', '中报显示，营收和净利润都获得增长，收入增长减缓。 同时，产业资本增持比较厉害。建议买入。\n--------------------------------------\n产业资本增持，为系统计算错误所致。忽略。', 'sz002470', '2016-08-18 23:48:25', '2016-08-18 23:48:25'), ('107', '拟如下买入：\n15.3  1000\n15.2  1000', 'sz002367', '2016-08-19 07:11:39', '2016-08-19 07:11:39'), ('108', '拟如下买入：\n8.4 1500\n8.3 1500', 'sz002470', '2016-08-19 07:13:33', '2016-08-19 07:13:33'), ('109', '各项指标很好，先15.3 买入1000股', 'sh600177', '2016-08-23 00:15:58', '2016-08-23 00:15:58'), ('110', '主要业务：\n  服装/地产/投资\n-----------------------------------------------------\n非产业化，怎么看？ 业绩变脸估计也很快吧。可以理解为创投企业', 'sh600177', '2016-08-23 22:23:01', '2016-08-23 22:23:01'), ('111', '公司电梯行业市占率3%左右，民族品种中位列第一，部分地区，如腾冲、西双版纳等地市占率超过50%。\n公司产品竞争力不断增强，毛利率有望继续提升。2015 年通力、迅达、富士达等国际电梯巨头报告期内纷纷压低市场价格以保持在华市场份额，康力电梯作为民族品牌龙头企业，报告期内营业利润率逆势上升至 17.90%。我们认为一方面轨道交通站、新机场建设使得新梯市场扩容，另一方面公司电梯产品竞争力不断上升，有望抢占更大市场份额。', 'sz002367', '2016-08-24 11:59:23', '2016-08-24 11:59:23'), ('112', '出售了控股子公司南京金羚房地产开发有限公司的股权,导致利润大增。主营业务变化微小。', 'sh600889', '2016-08-24 23:37:22', '2016-08-24 23:37:22'), ('113', '营收降低，但利润增长。得益于煤炭价格下跌。', 'sz000966', '2016-08-24 23:43:21', '2016-08-24 23:43:21'), ('114', '在医药股中财务指标较好。 一季度持股人中包括淡水泉和QFII。 拟22块钱先买入500股。', 'sh600196', '2016-08-25 10:04:47', '2016-08-25 10:04:47'), ('115', '购买价提高到22.5，买入500股；22，买入500股。', 'sh600196', '2016-08-26 22:26:19', '2016-08-26 22:26:19'), ('116', '近期内部有人增持股票', 'sz000997', '2016-08-28 23:38:31', '2016-08-28 23:38:31'), ('117', '近期内部有人增持股票。 所以开始关注。', 'sz000667', '2016-08-28 23:38:51', '2016-08-28 23:38:51'), ('118', '内部有人增持股票，关注~', 'sz002588', '2016-08-28 23:39:29', '2016-08-28 23:39:29'), ('119', '房地产股。 同行比较，市盈率不低。', 'sz000667', '2016-08-29 09:34:59', '2016-08-29 09:34:59'), ('120', '整个电力行业，特别是火电行业，都存在产能过剩的问题。并不看好。', 'sz000966', '2016-08-29 22:03:09', '2016-08-29 22:03:09'), ('121', '房地产业务，净现金含量负值', 'sh600823', '2016-09-01 22:47:23', '2016-09-01 22:47:23'), ('122', '收益稳定性不好', 'sh600894', '2016-09-01 22:47:55', '2016-09-01 22:47:55'), ('123', '家居行业发展趋势之一：定制家居盈利能力良好，无库存压力，存在隐形壁垒，从家居定制化到全屋定制。目前定制家居行业渗透率整体低于国外水平，定制橱柜行业渗透率较高，约为60%左右，而定制衣柜渗透率为20%-30%左右，定制衣柜业务在未来还有很大的提升空间。随着行业发展趋于成熟，企业管理逐步跟上，一些定制公司开始横向扩展定制家具的品类。\n\n家居行业发展趋势之二：家装互联网化。齐家网、土巴兔、爱空间、有住网等十几家家装020 崛地而起，约200 家具有品牌的互联网家装公司2015 年产生了59 笔融资。互联网家装顺应了互联网+趋势，依托互联网平台，通过去中介化、去渠道化及标准化，优化并整合装修产业链，目前互联网家装两种模式：以土巴兔、齐家网为代表的平台撮合模式，以爱空间、有住网为代表的自营整包模式。\n\n家居行业发展趋势之三：传统家装公司互联网改革。2015 年10 月东易日盛与阿里天猫家装携手推出“速美超级家”：互联网引流、线上负责装修方案（核心优势之一“DIM+技术”）、从国外品牌商规模采购并自建仓储物流体系、加盟商提供线下体验和装修服务。', 'sz000910', '2016-09-02 11:33:16', '2016-09-02 11:33:16'), ('124', '大股东在增持，增持价达到23元', 'sh600196', '2016-09-02 11:34:21', '2016-09-02 11:34:21'), ('125', '各项财务数据较好。市盈率低，历史低位。营收下降，净利润提高。 利润成长时，现金流同比成长。 同时，可支配现金比例很高。', 'sz002419', '2016-09-05 14:51:34', '2016-09-05 14:51:34'), ('126', '现金在营收比中，相比去年连续两季度下跌。 增长质量不高，潜力有限。\n逢高抛掉，如果可以，再低价接回吧。如果接不回，就算了。总之，不能高价买入。\n-----------------------------------------------\n拟 8.5 卖出2500 股', 'sz002470', '2016-09-06 20:56:15', '2016-09-06 20:56:15'), ('127', '处于历史市盈率高点，是否需要卖出，波段操作？？现金营收比同比微跌-1%，业绩提升受限。\n--------------------------\n卖出。买入天虹商场，质量更好', 'sh600660', '2016-09-06 21:03:54', '2016-09-06 21:03:54'), ('128', '半年报中的现金流为负值，经过调查确认，为税收增加所致。因此不影响财务向上的评估。 市价买入。\n-----------------------\n营收历史上首次负增长', 'sz002419', '2016-09-06 21:27:46', '2016-09-06 21:27:46'), ('129', '高管增持彰显公司价值', 'sz002419', '2016-09-06 21:33:34', '2016-09-06 21:33:34'), ('130', '强周期股', 'sh601872', '2016-09-07 12:11:20', '2016-09-07 12:11:20'), ('131', '拟17.0 清盘', 'sh600660', '2016-09-07 21:38:24', '2016-09-07 21:38:25'), ('132', '研报显示，机构关注人数较多。 ', 'sh600309', '2016-09-10 19:30:05', '2016-09-10 19:30:05'), ('133', '多元化化，搞投资和实业并举。相比康力电梯，在主页上不够专注。 广东国资委控股，机制限制。', 'sh600894', '2016-09-10 20:50:34', '2016-09-10 20:50:34'), ('134', '和招商轮船类似，受益于石油的回归。两者市盈率差不多，招商轮船股东中私募较多，买了招商轮船就不买海油工程了', 'sh600583', '2016-09-10 20:53:21', '2016-09-10 20:53:21'), ('135', '考虑目前持有现金较少，同时也想买入招商轮船。 在金正大和福耀玻璃之间犹豫。 福耀玻璃处理历史高位，考虑卖出，但绝对市盈率并不高。同时，机构关注很少。建议这两个股票都清盘吧。\n', 'sz002470', '2016-09-10 21:02:06', '2016-09-10 21:02:06'), ('136', '半年报现金流减少，主要原因是公司采购提高了先款后货方式的占比，增加了当期现金流出。', 'sz002470', '2016-09-10 21:17:47', '2016-09-10 21:17:47'), ('137', '控股股东中航工业,2014年董事长赖伟宣从飞亚达和天虹商场辞职。因工作原因。', 'sz002419', '2016-09-18 10:38:05', '2016-09-18 10:38:05'), ('138', '从2013年开始转型O2O，做全渠道。效果有待观察。', 'sz002419', '2016-09-18 12:19:14', '2016-09-18 12:19:14'), ('139', '五龙公司2014年7月7日减持均价为9.61元/股，2015年3月27日减持均价为14.90元/股，两次减持约套现4亿元。\n\n减持后，五龙公司仍持有天虹商场33.75%股份，仍为第二大股东。在当日披露的简式权益报告书中，五龙公司称，减持是基于自身资金需求，不排除在未来12个月内继续减持在公司拥有权益的股份。\n－－－－－－－－－－－－－－－－－－－－－－－－－－－－－－－－－－－－\n从2015年开始，黄俊康旗下公司两次减持天虹套现近10亿元，目前持股29.03%仍为第二大股东。', 'sz002419', '2016-09-18 12:22:40', '2016-09-18 12:22:40'), ('140', '2014年9月15日大宗交易卖方系天虹商场另一股东深圳市奥尔投资发展有限公司。时代周报记者查阅天虹商场招股说明书，深圳市奥尔投资发展有限公司系天虹商场管理层持股公司。\n\n除却上述9月15日大宗交易，该管理层持股公司还在同期通过集中竞价交易减持了657.8482万股，交易价格为11.6元/股。', 'sz002419', '2016-09-18 12:32:04', '2016-09-18 12:32:04'), ('141', '持股历史显示奥尔投资一直在减持股份', 'sz002419', '2016-09-18 12:35:18', '2016-09-18 12:35:18'), ('142', '2015年10月底，康力电梯披露修改版的定增方案，公司拟以不低于15.11元/股非公开发行6022.5万股', 'sz002367', '2016-09-20 20:50:04', '2016-09-20 20:50:04'), ('143', '董事长在增持。财务总监减持30万股。', 'sz002367', '2016-09-20 21:01:11', '2016-09-20 21:01:11'), ('144', '2013年8月5日晚间，康力电梯（002367）公告，截至2013年7月31日，公司回购股数量共计1106.32万股，占公司总股本的比例为2.91％，成交的最高价为10.73元/股（调整后），最低价为9.29元/股。动用资金在1.1亿元', 'sz002367', '2016-10-05 16:55:55', '2016-10-05 16:55:55'), ('145', '北京百强新家商贸有限公司总经理何弘毅称，百强专业做家具20余年，讲究的就是信誉和口碑，旗下百强·哈利木屋青少年实木系列家具专为孩子设计', 'sz000910', '2016-10-06 11:24:56', '2016-10-06 11:24:56'), ('146', '地板行业整体进入低增长通道，甚至滞涨的通道之中。虽然一些大企业还能保持两位数的增长，但整个行业的增长很难重现过去几年的态势。二是，从竞争手段来看，单一的价格战，甚至是渠道战，促销战，都不足以改变和推动产业的变革和消费需求的刺激。必须要寻找和建立新的引爆手段。三是，从消费需求来看，整个市场的消费者胃口更加的多元化、细分化，地板企业的精品战略也将面临新的修整。\n\n    当然，对于所有地板厂商来说，一个最大挑战，就是整个产业运营已经进入“低利润，甚至微利、薄利”的阶段，大量商业投机都将会被清理出局', 'sz000910', '2016-10-08 21:27:45', '2016-10-08 21:27:45'), ('147', '2015年度，受地热门、美国毒地板、上海质监发布风险预警等事件影响，中国消费者对于复合地板，尤其是复合地热地板的信任度大幅下降，普遍担忧其甲醛超标问题，这导致2015年复合地板产量加速下滑。因此，健康舒适的实木地板受到了大部分高端消费者的青睐。受此影响，加之“实木地板联盟”的力推，2016年实木地板将逆市崛起，重回消费主流地位', 'sz000910', '2016-10-08 21:30:18', '2016-10-08 21:30:18'), ('148', '复星医药控股股东复星集团于8月31日通过竞价买入方式以均价约23.28元/股增持公司A股股份125万股，分别占公司已发行A股股份总数的约0.07%和已发行股份总数的约0.05%，增持总金额约为2910万元。根据增持计划，复星集团拟在自2016年1月28日起的12个月内，择机在二级市场增持金额不低于7000万元，累计增持比例不超过公司已发行股份总数的2%。', 'sh600196', '2016-10-11 08:47:29', '2016-10-11 08:47:29'), ('149', '拟18元买入1万元。近一个月相对大盘弱势，主要受二股东抛售影响所致。 个人判断主力犹在，应能消化利空，收复失地。\n个人也受万华化学的爆炸影响，短期超跌，目前已经回到原来价位。\n所以打算做一个波段。因为股票已经超买，所以等回到原基准价21元后卖出，保持股票比例不变。\n在股票基本面上，低息高抛，提高收益。（尝试。。。。）', 'sz000910', '2016-10-12 08:25:26', '2016-10-12 08:25:27'), ('150', '股东中个人投资者较多，出大股东增持，其余人在不断减持\n新材料塑料产业背景不错。但中报显示销量增，单价降。\n公司还是不够聚焦，搞金融（设立银行）供应链金融及其他非股权投资\n－－－－－－－－－－－\n申请设立花城银行，没列入首批试点银行。 有足够准备进入金融领域。', 'sh600143', '2016-10-14 08:28:42', '2016-10-14 08:28:42'), ('151', '第二大股东宋子明于2015年4月24日至2015年4月29日，通过交易系统累计减持公司股份25,109,038股，占总股本的0.98%；2016年3月22日，宋子明通过大宗交易减持公司股份30,000,000股，占总股本的1.17%。', 'sh600143', '2016-10-14 08:30:59', '2016-10-14 08:30:59'), ('152', '2013年12月1日至12月26日期间，公司回购股份数量为1161.3099万股。\n\n公司于2013年8月19日首次实施了回购。截至2013年12月26日，公司回购股份数量为5270.0882万股，占公司总股本的比例为2%，购买的最高价为5.81元/股，最低价为4.91元/股，支付的总金额约为2.88亿元（含佣金）。', 'sh600143', '2016-10-15 08:32:24', '2016-10-15 08:32:24'), ('153', '利润增长有点不稳定。\n2011年试图通过降解地膜在2015年实现营收翻番，未实现。', 'sh600143', '2016-10-15 09:19:59', '2016-10-15 09:19:59'), ('154', '目前现金配置过多。复星医药一直出在盘整中，计划23元买入1000股。\n-----------\n没有买入，今天报价提高到23.1买入1000股。主要考虑是目前现金配置比例过高。', 'sh600196', '2016-10-24 22:52:36', '2016-10-24 22:52:36'), ('155', '股东情况和业务发展情况没有信心。逢高减持。目前成本价13.02，拟13.1先卖出1000. 择机逢高再卖出1000.\n撤离天虹商场。集中股票数量在5只左右。', 'sz002419', '2016-10-24 22:54:49', '2016-10-24 22:54:49'), ('156', '目前现金配置较多，本股票自买入已涨了10%以上，计划增持5.6买入3000股。\n－－－－－－－－－－－\n5.6买入成功。计划再买入3000股。如果跌到5.3元以下考虑买入。 如果再涨，有一定涨幅后就全仓杀入，摊平前期涨幅。确保自己投资心理处于一个积极的心态。跌势买入的逻辑是，目前大盘处于低位，现金配置不应太低。 现金留20%，即4万左右即可。', 'sh601872', '2016-10-24 23:00:29', '2016-10-24 23:00:29'), ('157', '2016-08-18以15.41的价格定向募集资金9亿，募集对象包括：\n序                                获配价格                      获配股数      锁定期 \n             发行对象名称                      获配金额(元） \n号                                 (元/股)                        （股）      限（月） \n1    财通基金管理有限公司              15.41   238,999,992.69    15,509,409        12 \n 2   上海爱康富罗纳资产管理有限公司 \n                                      15.41    99,999,989.72     6,489,292        12 \n3    上海隆源资产经营有限公司          15.41   199,999,994.85    12,978,585        12 \n4    国泰基金管理有限公司              15.41   169,999,991.77    11,031,797        12 \n5    五矿资本控股有限公司              15.41    99,999,989.72     6,489,292        12 \n6    国投瑞银基金管理有限公司          15.41    99,999,989.72     6,489,292        12 \n7    汇添富基金管理股份有限公司        15.41     1,000,047.36        64,896        12 \n－－－－－－－－－－－－－－－－－\n在资本寒冬下，公司以市场价募集资金，透露出公司的内在品质。或许。。。。', 'sz002367', '2016-10-27 08:14:54', '2016-10-27 08:14:54'), ('158', '半年报显示，主要发展的 木地板和人造板 营收增长率为 4%－5%', 'sz000910', '2016-10-28 09:32:44', '2016-10-28 09:32:44'), ('159', '最近报告显示，存货和应收款在减少', 'sz000910', '2016-10-28 09:33:13', '2016-10-28 09:33:13'), ('160', '今天跌的比较厉害。 打算在未来挂5.1元，达到满仓持有。 \n未来如果再跌，要坚持持有。', 'sh601872', '2016-10-29 23:01:53', '2016-10-29 23:01:53'), ('161', '价格若接近14时买入股票，达到满仓。', 'sz002367', '2016-10-29 23:04:31', '2016-10-29 23:04:31'), ('162', '逢高13.1 卖出股票。 目前几只想买的股票已经买到，可以卖出本股获得现金。', 'sz002419', '2016-10-29 23:05:37', '2016-10-29 23:05:37'), ('163', '营收账款不断上升，现金流失严重。比同行业的江南嘉捷好。 营收产出现金小于10%，只能说行业本身不好吧。', 'sz002367', '2016-11-24 21:48:41', '2016-11-24 21:48:41'), ('164', '持有上海三菱52%,三菱是电梯行业的一线品牌', 'sh600835', '2016-11-24 22:53:45', '2016-11-24 22:53:45');
COMMIT;

